import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';


class Line extends React.Component {

	render(){

		return (
			<div class='vl' style={{left:"50%"}}></div>
		)
	}	

}

class NavBar extends React.Component{

	render(){
		return (
			<nav class="bg-secondary navbar navbar-expand-lg p-4">
				<div class="collapse navbar-collapse">
						<ul class="navbar-nav">
								<li class="nav-item mx-4">
									<select>
										<option class="nav-link text-white" value="Bubble_Sort">Bubble Sort</option>
										<option class="nav-link text-white" value="Insertion_Sort">Insertion Sort</option>
										<option class="nav-link text-white" value="Quick_Sort">Quick Sort</option>
										<option class="nav-link text-white" value="Merge_Sort">Merge Sort</option>
									</select>

								</li>
								<li class="nav-item mx-4"><p class="nav-link text-white">Home2</p></li>
								<li class="nav-item mx-4"><p class="nav-link text-white">Home3</p></li>
								<li class="nav-item mx-4"><p class="nav-link text-white">Home4</p></li>
								<li class="nav-item mx-4"><p class="nav-link text-white">Home5</p></li>
						</ul>
				</div>
			</nav>
		)
	}

}


ReactDOM.render(
	<NavBar />,
	document.getElementById('root')
);
